INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (1, N'Blue Shoes ', N'The best shoes for wearing, when all your clothes are blue. They automatically change colour to fit your specific shade of blue ', 728.4500, 165, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (2, N'Banana Boat ', N'This boat will cater to all your seafaring needs. But only if picking water-bananas is involved ', 762000.0000, 3, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (3, N'Premium Banana', N'a long curved fruit which grows in clusters and has soft pulpy flesh and yellow skin when ripe', 2.0000, 2000000, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (4, N'F for Effort: More of the Very Best Totally Wrong Test Answers', N'From the author of the national bestseller F in Exams comes a brand new compendium of hilarious and inventive wrong test answers and homework hiccups. Featuring gems from elementary school ("two halves make a whale"), middle grades (Q: What does "germinate" mean? A: To become a German citizen), and high school (Q: Fossil fuels are usually associated with which major type of rock? A: Classic rock), these 250 examples of creative invention are sure to charm anyone who has had to bluff or blunder their way through a test. Plus, this is a fixed-format version of the book, which looks nearly identical to the print version. ', 60.0000, 120, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (5, N'Bunch of Bananas ', N'473 ripe bananas in a bunch. Ready to eat when we ship it, so you had better be ready to eat them when you receive them!!! ', 376.2300, 76, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (6, N' Brita Grand Water Filter Pitcher, Red, 10 Cup', N'Container Size: 80 oz. Material: Plastic Color: Red ', 35.0000, 45, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (7, N'Bath Water ', N'A bottle of bath water, guaranteed to have touched the cat that bathed in it. This cat is 3 months old and has blue-ish grey fur. It answers to the name of Pappacallaho ', 10.9900, 67, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (8, N'iPhone 2, non-functional ', N'A phone that has seen better days. It wont work, and we guarantee that the screen is broken. Be aware that tiny shards of glass may cut your fingers as you open the box. ', 1000.7200, 89, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (9, N'Toxic Waste Yellow Drum W/ sour Candy ', N' ', 20.0000, 100, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (10, N'Genuine Light Saber', N'This Light Saber is real, and you are able to slice your androids like butter, never before has it been as fun to go meet the younglings', 5000000.0000, 5, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (11, N'Gymnastic shorts ', N'Shorts that perform gymnastics for you, so that you dont need to perform yourself. Just throw them into the gym-hall, and watch them jumping and doing summersaults. Endless hours of fun! ', 997.3200, 6, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (12, N'Long Play Coder ', N'This coder will code for you for a loooooooooong time, performing well on any and all tasks given to him. But only on Linux and Windows XP systems. He answers to the name of LP ', 10110.0100, 1, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (13, N'Stonie Coder ', N'This coder can be used when creating Minecraft servers. Just plug him into a continuous drip of 1992 Jolt cola and watch him go. Endless hours of fun. He answers to the name DJ ', 101101.1100, 1, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (14, N'Clone Army ', N'Have you ever had any issues attacking or defending the galaxy, look no further, the product is produced by Sifo-Dyas and are ready to destroy all your enemies and worries ', 0.0000, 0, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (15, N'Yodaa doll ', N'This little doll is cute and cuddly and vaguely resembles Y**a from a copyrighted movie named S*** W***. We have no rights to this product or anything from the affiliated universe, so buy it at your own peril. It is shipped directly from the factory where original merchandise for this well known franchise is produced. ', 19.7800, 1978, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (16, N'Banana Water ', N'This water is mixed with premium bananas from the Banana Islands, just south of Puerto Ventura Ricolada, the capital of Wendurandela. The bananas are lovingly squished between a live horses thighs, and then sieved into pure spring water that has been left to ferment for 27 days in the hot Wendurandelan sun. Drink it and be surprised! ', 129.1200, 1000, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (17, N'Love ', N'Are you looking for love? This product is pure love in a jar. Just open it and feel it gushing out at you. You will feel loved for a long time or at least 10 seconds. Whichever comes first. ', 69.9600, 99, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (18, N'Banana meatloaf', N'You will never want normal meatloaf again', 25.0000, 21, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (19, N'Apple', N'Not an electronic company, but the delicious fruit', 5.0000, 456, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (20, N'Premium banana plane', N'Premium plane made out of bananas, runs on monkeys(not included) ', 50000.0000, 3, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (21, N'Banana phone', N'A phone and a banana in 1, dont eat it until your done talking! ', 999.0000, 7, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (22, N'Banana hub', N'A banana hub sure to be a-peel-ing to anyone with limited USB ports ', 25.0000, 36, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (23, N'Big Banana Cup', N'With great power comes great responsibility', 10.0000, 76, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (24, N'Das Star Wars Archiv. 19771983 ', N'Seit im Jahr 1977 zum ersten Mal der magische Einleitungssatz Es war einmal vor langer Zeit in einer weit, weit entfernten Galaxie ... über die Kinoleinwand flimmerte, sind Generationen von Film- und Scifi-Fans Luke Skywalker, Han Solo, Prinzessin Leia, R2-D2 und C-3PO und natürlich dem beliebtesten Schurken und schlimmsten Vater des Universums, Darth Vader, auf ihren abenteuerlichen Reisen durch die endlosen Weiten des Alls gefolgt, haben  je nach der individuellen sittlich-moralischen Grunddisposition  aufseiten der Rebellen oder der Sturmtruppen gekämpft, den Millenium Falken geschrottet, mit Meister Yoda die Syntax verunstaltet und das Lichtschwert tanzen lassen.', 900.0000, 10, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (25, N'Tefal E 85604 J.Oliver Pfanne 24 cm ', N'6-Lagen TEFAL Prometal Pro Antihaft-Versiegelung mit Hartgrundierung und Top Coat
THERMO-SPOT: Der weltweit erste in die Pfanne integrierte Temperaturanzeiger! Er zeigt an, wann die Pfanne die optimale Brattemperatur erreicht hat.
 ', 1000.0000, 20, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (26, N'Der neue Amazon Echo (3. Generation), smarter Lautsprecher mit Alexa, Anthrazit Stoff ', N'Lernen Sie Echo kennen  Echo (3. Gen.) bietet neue, hochwertige Lautsprecher mit Dolby-Verarbeitung, die den Raum mit purem 360-Grad-Klang mit klaren Höhen und dynamischen Bässen füllen. ', 3000.0000, 30, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (27, N'Single Malt Scotch Whisky Geschenk 1818 23-Karat Deutsches Blattgold - Schottischer Premium Whiskey - Geschenkidee für Männer ', N'Der Whisky Conde Lumar 1818 ist ein unvergleichlicher, extrem eleganter und aromatischer Whisky. Auf der Grundlage unserer Expertise und Erfahrung aus fast 200 Jahren haben wir ein einzigartiges Produkt geschaffen. Das Ergebnis ist ein Meisterwerk, das als Referenz für alles steht, was uns ausmacht: Geduld, Güte, Qualität und meisterhafte Handwerkskunst. ', 79.0000, 20, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (28, N'Der König der Löwen  Neuverfilmung 2019', N'ist ein computeranimierter US-amerikanischer Kinofilm von Jon Favreau, produziert von ihm selbst, Karen Gilchrist und Jeffrey Silver. ', 89.0000, 60, NULL)
INSERT [dbo].[TProduct] ([nProductId], [cName], [cDescription], [nUnitPrice], [nStock], [nAverageRating]) VALUES (29, N'Air Force two ', N'If you think number one is good you will love number two! ', 5000000.0000, 30, NULL)
