CREATE TABLE TUser_audits(
	nChangeId INT IDENTITY PRIMARY KEY,
    Old_UserId INT, 
    New_UserId INT, 

	Old_Username VARCHAR(16),
    New_Username VARCHAR(16),
    Old_Password VARCHAR(16),
    New_Password VARCHAR(16),
    Old_Name VARCHAR(255),
    New_Name VARCHAR(255),
    Old_Surname VARCHAR(255),
	New_Surname VARCHAR(255),
    Old_Address VARCHAR(100),
	New_Address VARCHAR(100),
    Old_CityId SMALLINT FOREIGN KEY REFERENCES TCity(nCityId),
	New_CityId SMALLINT FOREIGN KEY REFERENCES TCity(nCityId),

    Old_PhoneNumber VARCHAR(8),
	New_PhoneNumber VARCHAR(8),
	
	Old_Email VARCHAR(320),
	New_Email VARCHAR(320),
	
	Old_TotalPurchase MONEY DEFAULT (0),
	New_TotalPurchase MONEY DEFAULT (0),
	
	Old_IsActive BIT,
	New_IsActive BIT,

	updated_at DATETIME,
	updated_by NVARCHAR(256),
	updated_by_id VARBINARY(85),
	updated_host  NVARCHAR(128),
	updated_host_id CHAR(8),
	operation CHAR(1),
);
GO
CREATE TRIGGER trg_TUser_audits
	ON dbo.TUser
	AFTER INSERT, DELETE, Update
AS
BEGIN
DECLARE @Type CHAR(1);
DECLARE @updated_by NVARCHAR(256) = SUSER_SNAME();
DECLARE @updated_by_id VARBINARY(85) = SUSER_SID();

DECLARE @updated_host NVARCHAR(128) = HOST_NAME();
DECLARE @updated_host_id CHAR(8) = HOST_ID();

IF EXISTS (SELECT * FROM inserted)
       IF EXISTS (SELECT * FROM deleted)
               SELECT @Type = 'U'
       ELSE
               SELECT @Type = 'I'
ELSE
       SELECT @Type = 'D'

--CREATE TABLE #sp_who2 (SPID INT,Status VARCHAR(255),
--      Login  VARCHAR(255),HostName  VARCHAR(255),
--      BlkBy  VARCHAR(255),DBName  VARCHAR(255),
--      Command VARCHAR(255),CPUTime INT,
--      DiskIO INT,LastBatch VARCHAR(255),
--      ProgramName VARCHAR(255),SPID2 INT,
--      REQUESTID INT)
--INSERT INTO #sp_who2 EXEC sp_who2
--SELECT      TOP 1 @Login = Login, @HostName = HostName
--FROM        #sp_who2
---- Add any filtering of the results here :
--WHERE      HostName != '  .' AND DBName = 'DataBaseExam2019'


SET NOCOUNT ON;
	INSERT INTO TUser_audits(
	New_UserId,
	New_Username,
	New_Password,
	New_Name,
	New_Surname,
	New_Address,
	New_CityId,
	New_PhoneNumber,
	New_Email,
	New_TotalPurchase,
	New_IsActive,
	Old_UserId,
    Old_Username,
    Old_Password,
    Old_Name,
    Old_Surname,
    Old_Address,
    Old_CityId,
    Old_PhoneNumber,
	Old_Email,
	Old_TotalPurchase,
	Old_IsActive,
	updated_at,
	updated_by,
	updated_by_id,
	updated_host,
	updated_host_id,
	operation
	)

	SELECT
	i.nUserId,
	i.cUsername,
    i.cPassword,
    i.cName,
    i.cSurname,
    i.cAddress,
    i.nCityId,
    i.cPhoneNumber,
	i.cEmail,
	i.nTotalPurchase,
	i.bIsActive,
	d.nUserId,
	d.cUsername,
    d.cPassword,
    d.cName,
    d.cSurname,
    d.cAddress,
    d.nCityId,
    d.cPhoneNumber,
	d.cEmail,
	d.nTotalPurchase,
	d.bIsActive,
	GETDATE(),
	@updated_by,
	@updated_by_id,
	@updated_host,
	@updated_host_id,
	@Type
	FROM
	inserted i
	FULL OUTER JOIN deleted d
	ON d.nUserId = d.nUserId
END
GO
CREATE TABLE TCard_audits(
	nChangeId INT IDENTITY PRIMARY KEY,
    nCreditCardId INT,

	Old_CardNumber VARCHAR(16),
	New_CardNumber VARCHAR(16),

	Old_CardHolder VARCHAR(100),
	New_CardHolder VARCHAR(100),

	Old_ExpiringDate VARCHAR(4),
	New_ExpiringDate VARCHAR(4),

	Old_CCV VARCHAR(3),
	New_CCV VARCHAR(3),

	Old_TotalPurchase MONEY,
	New_TotalPurchase MONEY,

	Old_UserId INT,
	New_UserId INT,

	updated_at DATETIME,
	updated_by NVARCHAR(256),
	updated_by_id VARBINARY(85),
	updated_host  NVARCHAR(128),
	updated_host_id CHAR(8),
	operation CHAR(1),
);
GO
CREATE TRIGGER trg_TCreditCard_audits
	ON dbo.TCreditCard
	AFTER INSERT, DELETE, Update
AS
BEGIN
DECLARE @Type CHAR(1);
DECLARE @updated_by NVARCHAR(256) = SUSER_SNAME();
DECLARE @updated_by_id VARBINARY(85) = SUSER_SID();

DECLARE @updated_host NVARCHAR(128) = HOST_NAME();
DECLARE @updated_host_id CHAR(8) = HOST_ID();

IF EXISTS (SELECT * FROM inserted)
       IF EXISTS (SELECT * FROM deleted)
               SELECT @Type = 'U'
       ELSE
               SELECT @Type = 'I'
ELSE
       SELECT @Type = 'D'


SET NOCOUNT ON;
	INSERT INTO TCard_audits(
	nCreditCardId,
	New_CardNumber,
	New_CardHolder,
	New_ExpiringDate,
	New_CCV,
	New_TotalPurchase,
	New_UserId,
    Old_CardNumber,
    Old_CardHolder,
    Old_ExpiringDate,
    Old_CCV,
    Old_TotalPurchase,
    Old_UserId,
	updated_at,
	updated_by,
	updated_by_id,
	updated_host,
	updated_host_id,
	operation
	)

	SELECT
	i.nCreditCardId,
	i.cCardNumber,
    i.cCardHolder,
    i.cExpiringDate,
    i.cCCV,
    i.nTotalPurchase,
    i.nUserId,
	d.cCardNumber,
    d.cCardHolder,
    d.cExpiringDate,
    d.cCCV,
    d.nTotalPurchase,
    d.nUserId,
	GETDATE(),
	@updated_by,
	@updated_by_id,
	@updated_host,
	@updated_host_id,
	@Type
	FROM
	inserted i
	FULL OUTER JOIN deleted d
	ON d.nUserId = d.nUserId
	 


END
GO
CREATE OR ALTER TRIGGER trg_Prevent_deletion_Product
ON dbo.TProduct
FOR DELETE
AS
BEGIN
	DECLARE @ProductId INT = (SELECT nProductId FROM Deleted)
	DECLARE @PurchaseCount INT = (SELECT COUNT(*) FROM dbo.TProduct
		INNER JOIN dbo.TInVoiceLine
		ON dbo.TProduct.nProductId = dbo.TInVoiceLine.nProductId
		WHERE dbo.TProduct.nProductId = @ProductId);

	IF(@PurchaseCount > 0)
		RAISERROR('Records can not be deleted, as TProduct have purchased Item', 10,1)
		ROLLBACK TRAN
		RETURN
END
GO
CREATE OR ALTER TRIGGER trg_Prevent_deletion_User
ON dbo.TUser
FOR DELETE
AS
BEGIN
	DECLARE @Totalpurchase MONEY;
	SELECT @Totalpurchase = nTotalPurchase FROM deleted;
	IF(@Totalpurchase > 0)
		RAISERROR('Records can not be deleted, as user have purchased Item', 10,1)
		ROLLBACK TRAN
		RETURN
END
GO
